import React from "react";

import { Parallax, Background } from "react-parallax";
import cu from "../../3_images/2_theInitiative/bg_initiative-banner.jpg";

//COMPONENTS
import Line from "../2_module/Line";
import BackgroundImg from "./BackgroundImg";

//STYLES
import { HeaderStyle } from "../../2_styles/1_layout/HeaderStyle";

export default function Header({ bgImg, title, subtitle }) {
  return (
    <div>
      <HeaderStyle>
        {/* <BackgroundImg
          bgImg={bgImg}
          height="100vh"
          zIndexImg="-4"
          zIndexImgShadow="-3"
        /> */}

        <Parallax
          bgImage={require("../../3_images/2_theInitiative/bg_initiative-banner.jpg")}
          bgImageAlt="the cat"
          strength={500}
        >
          Put some text content here - even an empty div with fixed dimensions
          to have a height for the parallax.
          <div style={{ height: "200px" }} />
        </Parallax>

        <div className="title">
          <p>the</p>
          <p>{title}</p>
          <Line />
          <p>{subtitle}</p>
        </div>
      </HeaderStyle>
    </div>
  );
}
